import React, { useState, useEffect } from "react";
import axios from "axios";

function HelloWorld() {
  const [message, setMessage] = useState("");
  const [surroundingLinks, setSurroundingLinks] = useState("");
  const [surroundingTitles, setSurroundingTitles] = useState("");

  useEffect(() => {
    axios
      .get("http://localhost:8000/wikis/get-page-data/")
      .then((response) => {
        setMessage(response.data.title);
        setSurroundingLinks(
          decodeURIComponent(response.data.surrounding_links)
        );
        setSurroundingTitles(JSON.parse(response.data.surrounding_titles));
      })
      .catch((error) => {
        console.log(error);
      });
  }, []);

  const json_length = Object.keys(surroundingTitles).length;
  console.log(json_length);

  return (
    <div>
      <h1>Hello, World!</h1>
      <p>{message}</p>
      <p>{decodeURIComponent(surroundingTitles)}</p>
    </div>
  );
}

export default HelloWorld;
